import React from 'react';
import { Card } from 'antd';

// 컴포넌트를 작성하기 전에는 기획을 먼저 한다.
function PostCard({ post }) {
    return (
        <div>
            <Card
                cover={post.Image[0]}
            >
                <Image />
                <Content />
                <Buttons></Buttons>
            </Card>
            <CommentForm />
            <Comments />
        </div>
    );
};

export default PostCard
